import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TPIDsTitles = () => {
  const [todos, setTodos] = useState([]);

  useEffect(() => {
    const fetchTodos = async () => {
      try {
        const response = await axios.get('http://jsonplaceholder.typicode.com/todos');
        setTodos(response.data);
      } catch (error) {
        console.error('Error fetching todos:', error);
      }
    };

    fetchTodos();
  }, []);

  return (
    <div style={{ textAlign: 'center' }}>
      <style>
        {`
          .todos-table {
            width: 80%; /* Ajustamos el ancho de la tabla */
            margin: 0 auto; /* Centramos la tabla */
            border-collapse: collapse;
            margin-top: 20px;
          }

          .todos-table th,
          .todos-table td {
            padding: 12px; /* Incrementamos el padding */
            border: 1px solid #dddddd;
            text-align: center;
            color: white; /* Cambia el color del texto a blanco */
          }

          .todos-table th {
            background-color: #000; /* Cambia el color de fondo de la cabecera a negro */
            font-weight: bold;
            font-size: 20px; /* Cambiamos el tamaño del texto */
          }

          .todos-table td {
            background-color: #c35900; /* Cambia el color de fondo de las celdas */
          }
        `}
      </style>
      <h2 style={{ margin: '30px 0', color: 'white' }}>Lista de todos los pendientes (IDs y Títulos)</h2>
      <table className="todos-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Título</th>
          </tr>
        </thead>
        <tbody>
          {todos.map(todo => (
            <tr key={todo.id}>
              <td>{todo.id}</td>
              <td>{todo.title}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TPIDsTitles;
